import React, {Component} from 'react';
import { FlatList, StyleSheet, View, button, Text } from 'react-native';
import ForecastCard from '../ForecastCard';
import Icon from 'react-native-vector-icons/FontAwesome';

const iconButtn = <Icon.Button name="refresh" style={{backgroundColor:"#80a4e4",fontSize:"5",}}></Icon.Button>
export default class ForecastList extends Component {


    constructor(props){
        super(props);
      }
      refreshFunction = () => {
          console.log("55555555")
        this.props.onPress?.();
      }

    
render() {
  return (
    <View style={styles.button} onClick={this.refreshFunction}>
        <Text>Refrsh</Text>
        {/* {iconButtn} */}
    </View>
  );
}
}

const styles = StyleSheet.create({
  button:{
    // border: "3px solid black",
    backgroundColor: "#80a4e4",
    width: 60, 
    height:50
}
});
